wanMacClone:"Clonar la dirección MAC",wanMacCloneTip:"Podrá clonar la dirección MAC de su ordenador en su rúter o especificar manualmente una dirección MAC para el rúter",wanSelfDefDNS:"DNS definido por el usuario",wanSelfDefDNSTip:"Podrá especificar manualmente el servidor DNS. Un servicio DNS confiable y seguro puede proteger su red contra el secuestro de DNS.",offlineDownload:"De estar habilitado, podrá establecer una tarea de descarga y descargar directamente archivos del dispositivo de almacenamiento conectado al rúter",
offlineDownloadTip:"Podrá establecer la tarea de descarga por adelantado sin usar Internet. Cuando la tarea de descarga se iniciará cuando disponga de acceso a Internet.",parentCtrl:"El control parental administrará las reglas de acceso a Internet para sus dispositivos. Puede crear hasta 10 reglas de restricción en función de la semana, el día, la hora o el minuto.",parentCtrlV2:"La función de control parental puede regular eficazmente el tiempo de Internet de los niños, establecer un tiempo fijo de acceso a Internet y hacer un uso razonable del mismo.",
parentCtrlV2Tip1:'Si se le indicase que "El tiempo en línea permitido no se ha sincronizado con la hora de la red", el Control Parental no tendrá efecto, por lo tanto verifique su conexión a Internet.',parentCtrlV2Tip:"Nota: Podrá establecer un máximo de 10 reglas y el mismo dispositivo permiterá solo una regla.",parentCtrlV2Tip2:"",remoteMng:"Con el modo Acceso remoto habilitado, podrá acceder a su rúter a través de Internet para administrar la configuración de su rúter.",remoteMngTip:"Si configura la gestión del IP como 255.255.255.255, todos los dispositivos de la red podrán administrar remotamente su rúter",
safeMng:"La seguridad protegerá su red local contra el riesgo de ataques de Internet. Con el cortafuegos habilitado, todos los paquetes de datos provenientes de Internet serán escaneados para bloquear cualquier posible ataque. La protección de denegación de servicio (DoS) protegerá su red contra ataques que intenten evitar que los usuarios accedan al servicio de red. Podrá habilitar el modo Forbid WAN Ping si desea ignorar los paquetes ping del puerto WAN.",dosAttack:"",dosAttackTip:"",dosAttackTip1:"",
