autoUpgrade:"Haga clic en Buscar actualización para verificar si hay una nueva versión de firmware disponible. Si se encuentrase una nueva versión de firmware, haga clic en Actualizar para actualizar su rúter con la última versión.",autoUpgradeTip1:"Al establecer la hora de actualización personalizada, podrá detectar y actualizar automáticamente la versión del rúter",autoUpgradeTip2:'Si se le indicase que "El estado del sistema no se ha sincronizado con la hora de la red", la función de actualización automática no tendrá efecto, de modo que compruebe su conexión a Internet.',
autoUpgradeTip:"No interrumpa el proceso de actualización ya que podría dañar su rúter. Su rúter se reiniciará después de que se actualice el firmware.",usbStorage:"Con un dispositivo de almacenamiento USB conectado, podrá acceder a los archivos almacenados allí y configurar el cifrado de samba para la seguridad de los datos. Cuando desconecte su dispositivo de almacenamiento del rúter, haga clic en Quitar de forma segura para proteger los datos y evitar daños en su dispositivo.",usbRemoveNote:"Si ha conectado y utilizado el recurso compartido Samba antes sin nombre de usuario y contraseña protegidos e intentase acceder al recurso compartido con el cifrado samba habilitado, borre primero el caché de autenticación con el comando: uso neto * / eliminar",
usbTip:"El servidor de medios omitirá el cifrado. Se recomienda desactivar el servidor de medios si hay datos confidenciales o privados que deban protegerse en su recurso compartido de archivos.",usbTip1:"",usbTip2:"",networkTip:"Nota: Los caracteres especiales admitidos por el nombre de la red pueden incluir, pero no se limitan a: !\"# $% & '() * +, -. / :; <=? @ [\\] ^ _` {|} ~ y espacio",wisp:"Al usar la Extensión inalámbrica, los rúter principales y secundarios se podrán puentear para ampliar la cobertura de la red inalámbrica. La red inalámbrica extendida se podrá lograr escaneando automáticamente (recomendado) o especificando una red manualmente.",
wispTip:"El nombre de la red admite combinaciones de símbolos chinos, numéricos, alfabéticos y especiales.",upnp:"La conexión universal y de juegos (UPnP) ayuda a los dispositivos, como los dispositivos de Internet y a los dispositivos anfitriones a acceder a la red local y conectarse a otros dispositivos según sea necesario. Podrá habilitar la UPnP si desea jugar a juegos multijugador, comunicarse en tiempo real o disfrutar de una conexión punto a punto. Los dispositivos UPnP pueden descubrir automáticamente los servicios de otros dispositivos UPnP registrados en la red local.",
upnpTip:"Los dispositivos UPnP podrán identificarse automáticamente por las aplicaciones de servicio UPnP en la LAN.",portServerIp:"Servidor IP",portAgreeMent:"Protocolo",portExternal:"Puerto externo",portInternal:"Puerto interno",portFwdHelp:"Cuando el reenvío de puertos se encuentre habilitado, su rúter podrá reenviar el tráfico entrante con los protocolos especificados a los servidores adecuados (por ejemplo, FTP y servidores web) en su red local.",portFwdIp:"La dirección IP del ordenador como servidor en LAN.",
portFwdexter:"El número de puerto o rango abierto para Internet.",portFwdinter:"El número de puerto o rango abierto para LAN. Podrá dejarlo vacío cuando el puerto interno y el puerto externo sean iguales.",portFwdAgerr:"El protocolo utilizado por el servidor.",adminPwd:"Contraseña de inicio de sesión",adminPwdTip:"Establezca la contraseña que usará para administrar su rúter. No será la contraseña de su cuenta ISP o la contraseña de la red inalámbrica.",qos:"Podrá habilitar Calidad de servicio (QoS) y priorizar un tráfico específico sobre otros, o seleccionar Balance automático para optimizar automáticamente la operación eficiente para todos los servicios de Internet en ejecución.",
regionTimeZone:"",timeZone:"Seleccione su zona horaria local de la lista desplegable.",vpnClient:"El cliente de red privada virtual (VPN) se usa para conectarse a un servidor VPN para acceder de manera segura a los recursos privados a través de una red pública. Para iniciar una conexión VPN, deberá crear una regla para que los clientes se conecten al servidor VPN con el nombre de la regla, el protocolo, la dirección IP (o dominio) del servidor VPN y la información de autenticación de acceso configurada. Luego, haga clic en Conectar para establecer la Conexión VPN.",
vpnServer:"Deberá especificar la configuración del servicio de red privada virtual (VPN) (información de autenticación de protocolo y acceso) para que los clientes VPN accedan al servidor VPN. El cliente VPN tendrá acceso LAN local mientras esté conectado al servidor VPN.",wds:"Al usar el Sistema de Distribución Inalámbrica (WDS), el rúter puede funcionar como un rúter principal o uno secundario mediante el cual la red inalámbrica se podrá puentear y expandir para lograr una mayor cobertura de la señal. Podrá hacer clic en Escanear para buscar en la red inalámbrica a puentear y haga clic en Conectar para conectar la red inalámbrica. Si este rúter funcionase como rúter principal, deberá hacer clic en Conectar para adquirir la dirección MAC del rúter secundario antes de proceder a la configuración de puente inalámbrico en dicho rúter secundario.",
qosHelp:"Podrá habilitar la Calidad de servicio (QoS) y priorizar un tráfico específico sobre otros.",light:"Configurar la pantalla LED (encendido / apagado).",lightTip:"Nota: Al reiniciar el enrutador en el estado desactivado, el indicador volverá al estado de encendido tras 5 minutos.",printer:"Con la función habilitada, conecte su impresora al rúter utilizando un cable USB para que pueda compartir la impresora con el PC (s) del cliente en su red",printerTip:"Asegúrese de que la herramiento para compartir la impresora Phicomm se encuentre instalada y configurada correctamente en el PC del cliente.",
wifiTimeSwitch:"Interruptor de tiempo WIFI",wifiTimeSwitchTip:"El WIFI se puede encender / apagar automáticamente de acuerdo con la programación preestablecida. Si la hora actual del sistema se encontrase en el rango de la hora del WIFI, la configuración tendrá efecto a partir del día siguiente. Asegúrese de que la conexión a Internet se encuentre activa y que la hora del sistema se haya sincronizado con un NTP. La configuración no tendrá efecto cuando el tiempo de encendido y el tiempo de apagado sean los mismos.",
guestTimeSwitchTip:"El WIFI vinculado se puede activar / desactivar automáticamente de acuerdo con la programación preestablecida. Si la hora actual del sistema se encontrase en el rango de la hora del WIFI vinculado, la configuración entrará en vigencia a partir del día siguiente. Asegúrese de que la conexión a Internet esté activa y que la hora del sistema se haya sincronizado con un NTP. La configuración no tendrá efecto cuando el tiempo de encendido y el tiempo de apagado sean los mismos.",specialCharacter:"Nota: Los caracteres especiales admitidos pueden incluir, entre otros: !\"# $% & \\ '() * +, -. / :; <> =? @ [\\] ^ _` {|} ~ y espacio.",
